import React, { PureComponent } from 'react';


class User extends PureComponent {
    render() {

        return (<div>
            <div > Name : &nbsp; 
                {this.props.user.userName}
            </div>
            <div > Phone no. : &nbsp; 
                {this.props.user.userPhoneNo}
            </div>
            <div > Email : &nbsp; 
                {this.props.user.userEmail}
            </div>
            <div > Blood Group : &nbsp; 
                {this.props.user.bloodGroup}
            </div>
        </div>
        )
    }
}

export default User;
